import React, { Component } from "react";
import App from "../App"
import MoviesListComponent from "../components/MoviesListComponent";
import Footer from "../components/Footer";

class HomePage extends Component {
  render() {
    return (
      // <div className="App">
      <App>
        <div>
          <MoviesListComponent />
        </div>
        <Footer />
      </App>
      // </div>
    );
  }
}

export default HomePage;
